BOOL MapHeader_MapIsPokemonCenter(u32 map_no) {
    for (s32 i = 0; i < (s32)NELEMS(sPokemonCenterMaps); i++) {
        if (map_no == sPokemonCenterMaps[i]) {
            return TRUE;
        }
    }

    return FALSE;
}

